xFGradientY3x3(typename PixelType<DEPTH_SRC>::name t0,
               typename PixelType<DEPTH_SRC>::name t1,
               typename PixelType<DEPTH_SRC>::name t2,
               typename PixelType<DEPTH_SRC>::name m0,
               typename PixelType<DEPTH_SRC>::name m1,
               typename PixelType<DEPTH_SRC>::name m2,
               typename PixelType<DEPTH_SRC>::name b0,
               typename PixelType<DEPTH_SRC>::name b1,
               typename PixelType<DEPTH_SRC>::name b2) {

#pragma HLS INLINE off


    typename PixelType<DEPTH_DST>::name g_y = 0;

    short int M00 = ((short int)t1 << 1);
    short int M01 = ((short int)b1 << 1);
    short int A00 = (b0 + b2);
    short int S00 = (t0 + t2);

    short int out_pix;
    out_pix = M01 - M00;
    out_pix = out_pix + A00;
    out_pix = out_pix - S00;

    g_y = (typename PixelType<DEPTH_DST>::name)out_pix;

    if ((DEPTH_DST == XF_8UP) || (DEPTH_DST == XF_24UP)) {
        if (out_pix < 0) {
            g_y = 0;
        } else if (out_pix > 255) {
            g_y = 255;
        }
    }
    return g_y;
}





template <int PLANES, int NPC, int DEPTH_SRC, int DEPTH_DST>
void xFSobel3x3(typename PixelType<DEPTH_DST>::name * GradientvaluesX,
                typename PixelType<DEPTH_DST>::name * GradientvaluesY,
                typename PixelType<DEPTH_SRC>::name * src_buf1,
                typename PixelType<DEPTH_SRC>::name * src_buf2,
                typename PixelType<DEPTH_SRC>::name * src_buf3) {

#pragma HLS INLINE off


    int STEP, STEP_OUT;
    if ((DEPTH_DST == XF_48SP) || (DEPTH_DST == XF_16SP)) {
        STEP_OUT = 16;
        STEP = 8;
    } else {
        STEP_OUT = 8;
        STEP = 8;
    }

Compute_Grad_Loop:
    for (ap_uint<5> j = 0; j < xfNPixelsPerCycle<NPC>::nppc; j++) {
        int p = 0;

#pragma HLS UNROLL

        for (ap_uint<5> c = 0, k = 0; c < PLANES; c++, k += STEP) {
            GradientvaluesX[j].range(p + (STEP_OUT - 1), p) = xFGradientX3x3<DEPTH_SRC, DEPTH_DST>(
                src_buf1[j].range(k + STEP - 1, k), src_buf1[j + 1].range(k + STEP - 1, k),
                src_buf1[j + 2].range(k + STEP - 1, k), src_buf2[j].range(k + STEP - 1, k),
                src_buf2[j + 1].range(k + STEP - 1, k), src_buf2[j + 2].range(k + STEP - 1, k),
                src_buf3[j].range(k + STEP - 1, k), src_buf3[j + 1].range(k + STEP - 1, k),
                src_buf3[j + 2].range(k + STEP - 1, k));

            GradientvaluesY[j].range(p + (STEP_OUT - 1), p) = xFGradientY3x3<DEPTH_SRC, DEPTH_DST>(
                src_buf1[j].range(k + STEP - 1, k), src_buf1[j + 1].range(k + STEP - 1, k),
                src_buf1[j + 2].range(k + STEP - 1, k), src_buf2[j].range(k + STEP - 1, k),
                src_buf2[j + 1].range(k + STEP - 1, k), src_buf2[j + 2].range(k + STEP - 1, k),
                src_buf3[j].range(k + STEP - 1, k), src_buf3[j + 1].range(k + STEP - 1, k),
                src_buf3[j + 2].range(k + STEP - 1, k));
            p += STEP_OUT;
        }
    }
}




template <int SRC_T,
          int DST_T,
          int ROWS,
          int COLS,
          int PLANES,
          int DEPTH_SRC,
          int DEPTH_DST,
          int NPC,
          int XFCVDEPTH_IN = _XFCVDEPTH_DEFAULT,
          int XFCVDEPTH_gradx = _XFCVDEPTH_DEFAULT,
          int XFCVDEPTH_grady = _XFCVDEPTH_DEFAULT,
          int WORDWIDTH_SRC,
          int WORDWIDTH_DST,
          int TC>
void ProcessSobel3x3(xf::cv::Mat<SRC_T, ROWS, COLS, NPC, XFCVDEPTH_IN>& _src_mat,
                     xf::cv::Mat<DST_T, ROWS, COLS, NPC, XFCVDEPTH_gradx>& _gradx_mat,
                     xf::cv::Mat<DST_T, ROWS, COLS, NPC, XFCVDEPTH_grady>& _grady_mat,
                     typename StreamType<WORDWIDTH_SRC>::name buf[3][(COLS >> xfNPixelsPerCycle<NPC>::datashift)],
                     typename PixelType<DEPTH_SRC>::name src_buf1[xfNPixelsPerCycle<NPC>::nppc + 2],
                     typename PixelType<DEPTH_SRC>::name src_buf2[xfNPixelsPerCycle<NPC>::nppc + 2],
                     typename PixelType<DEPTH_SRC>::name src_buf3[xfNPixelsPerCycle<NPC>::nppc + 2],
                     typename PixelType<DEPTH_DST>::name GradientValuesX[xfNPixelsPerCycle<NPC>::nppc],
                     typename PixelType<DEPTH_DST>::name GradientValuesY[xfNPixelsPerCycle<NPC>::nppc],
                     typename StreamType<WORDWIDTH_DST>::name & P0,
                     typename StreamType<WORDWIDTH_DST>::name & P1,
                     uint16_t img_width,
                     uint16_t img_height,
                     ap_uint<13> row_ind,
                     uint16_t& shift_x,
                     uint16_t& shift_y,
                     ap_uint<2> tp,
                     ap_uint<2> mid,
                     ap_uint<2> bottom,
                     ap_uint<13> row,
                     int& read_index,
                     int& write_index) {

#pragma HLS INLINE


    typename StreamType<WORDWIDTH_SRC>::name buf0, buf1, buf2;
    uint16_t npc = xfNPixelsPerCycle<NPC>::nppc;
    ap_uint<5> buf_size = xfNPixelsPerCycle<NPC>::nppc + 2;

Col_Loop:
    for (ap_uint<13> col = 0; col < img_width; col++) {

#pragma HLS LOOP_TRIPCOUNT min=TC max=TC
#pragma HLS pipeline

        if (row < img_height)
            buf[row_ind][col] = _src_mat.read(read_index++);
        else
            buf[bottom][col] = 0;
        buf0 = buf[tp][col];
        buf1 = buf[mid][col];
        buf2 = buf[bottom][col];

        if (NPC == XF_NPPC8) {
            xfExtractPixels<NPC, WORDWIDTH_SRC, DEPTH_SRC>(&src_buf1[2], buf0, 0);
            xfExtractPixels<NPC, WORDWIDTH_SRC, DEPTH_SRC>(&src_buf2[2], buf1, 0);
            xfExtractPixels<NPC, WORDWIDTH_SRC, DEPTH_SRC>(&src_buf3[2], buf2, 0);
        } else {
            src_buf1[2] = buf0;
            src_buf2[2] = buf1;
            src_buf3[2] = buf2;
        }

        xFSobel3x3<PLANES, NPC, DEPTH_SRC, DEPTH_DST>(GradientValuesX, GradientValuesY, src_buf1, src_buf2, src_buf3);

        if (col == 0) {
            shift_x = 0;
            shift_y = 0;
            P0 = 0;
            P1 = 0;

            xfPackPixels<NPC, WORDWIDTH_DST, DEPTH_DST>(&GradientValuesX[0], P0, 1, (npc - 1), shift_x);
            xfPackPixels<NPC, WORDWIDTH_DST, DEPTH_DST>(&GradientValuesY[0], P1, 1, (npc - 1), shift_y);

        } else {
            xfPackPixels<NPC, WORDWIDTH_DST, DEPTH_DST>(&GradientValuesX[0], P0, 0, 1, shift_x);
            xfPackPixels<NPC, WORDWIDTH_DST, DEPTH_DST>(&GradientValuesY[0], P1, 0, 1, shift_y);

            _gradx_mat.write(write_index, P0);
            _grady_mat.write(write_index++, P1);

            shift_x = 0;
            shift_y = 0;
            P0 = 0;
            P1 = 0;

            xfPackPixels<NPC, WORDWIDTH_DST, DEPTH_DST>(&GradientValuesX[0], P0, 1, (npc - 1), shift_x);
            xfPackPixels<NPC, WORDWIDTH_DST, DEPTH_DST>(&GradientValuesY[0], P1, 1, (npc - 1), shift_y);
        }

        src_buf1[0] = src_buf1[buf_size - 2];
        src_buf1[1] = src_buf1[buf_size - 1];
        src_buf2[0] = src_buf2[buf_size - 2];
        src_buf2[1] = src_buf2[buf_size - 1];
        src_buf3[0] = src_buf3[buf_size - 2];
        src_buf3[1] = src_buf3[buf_size - 1];
    }
}
