template <int DEPTH, int INTERPOLATION_TYPE, int NPPC>
void interpolatePixel(typename PixelType<DataType<DEPTH, NPPC>::pixeldepth>::name A0,
                      typename PixelType<DataType<DEPTH, NPPC>::pixeldepth>::name B0,
                      typename PixelType<DataType<DEPTH, NPPC>::pixeldepth>::name A1,
                      typename PixelType<DataType<DEPTH, NPPC>::pixeldepth>::name B1,
                      ap_ufixed<12, 2> Wx,
                      ap_ufixed<12, 2> Wy,
                      typename PixelType<DataType<DEPTH, NPPC>::pixeldepth>::name & pixel) {

#pragma HLS inline

    const int CHANNEL_NUM = DataType<DEPTH, NPPC>::channel;
    const int DATA_BW = DataType<DEPTH, NPPC>::pixelwidth/CHANNEL_NUM;


    if (INTERPOLATION_TYPE == XF_INTERPOLATION_NN) {
        pixel = A0;
    } else {
        ap_ufixed<12, 2> Wxy;
        ap_int<DATA_BW + 2> val0, val1, val2;
        ap_fixed<DATA_BW + 14, DATA_BW + 4> P1, P2, P3, P4;

        Wxy = (Wx * Wy);
        val0 = (A0 + B1 - (B0 + A1));
        val1 = (B0 - A0);
        val2 = (A1 - A0);

        P1 = (val0 * Wxy);
        P2 = (val1 * Wy);
        P3 = (val2 * Wx);
        P4 = (A0);

        pixel = (typename PixelType<DataType<DEPTH, NPPC>::pixeldepth>::name)((ap_fixed<DATA_BW + 18, DATA_BW + 8>)(P1 + P2 + P3 + P4));

    }
}
